import React, { useEffect, useState, useContext, useMemo } from "react";
import { useParams, useNavigate, useLocation } from "react-router-dom";
import { BarGraph } from "src/components";
import axios from "axios";

import * as S from "./styled";

export const ShowMyPlan = () => {
  let { id } = useParams(); // Ïû¨Ìï†Îãπ Í∞ÄÎä•
  let navigate = useNavigate();
  const [listOfPosts, setListOfPosts] = useState([
    {
      user_id: "",
      createdAt: "",
    },
  ]);
  const [Posts, setPosts] = useState({
    kor: 0,
    eng: 0,
    math: 0,
    sci: 0,
    com: 0,
    kh: 0,
    study: 0,
  });
  const [UserId, setUserId] = useState({});
  const [authState, setAuthState] = useState({
    id: 0,
    status: false,
  });
  const subData = useMemo(
    () => [
      {
        id: 1,
        sub: "Íµ≠Ïñ¥",
        time: Posts.kor,
      },
      {
        id: 2,
        sub: "ÏòÅÏñ¥",
        time: Posts.eng,
      },
      {
        id: 3,
        sub: "ÏàòÌïô",
        time: Posts.math,
      },
      {
        id: 4,
        sub: "Í≥ºÌïô",
        time: Posts.sci,
      },
      {
        id: 5,
        sub: "ÏÇ¨Ìöå",
        time: Posts.com,
      },
      {
        id: 6,
        sub: "ÌïúÍµ≠ÏÇ¨",
        time: Posts.kh,
      },
      {
        id: 7,
        sub: "Í≥µÎ∂Ä",
        time: Posts.study,
      },
    ],
    [Posts]
  );

  const time = useMemo(
    () => ({
      labels: subData.map((val) => val.sub),
      datasets: [
        {
          label: "ÏãúÍ∞ÑÎç∞Ïù¥ÌÑ∞",
          data: subData.map((val) => val.time),
          backgroundColor: [
            "rgba(255, 99, 132, 0.2)",
            "rgba(255, 159, 64, 0.2)",
            "rgba(255, 205, 86, 0.2)",
            "rgba(75, 192, 192, 0.2)",
            "rgba(54, 162, 235, 0.2)",
            "rgba(153, 102, 255, 0.2)",
            "rgba(84, 221, 154, 0.2)",
          ],
          borderColor: [
            "rgb(255, 99, 132)",
            "rgb(255, 159, 64)",
            "rgb(255, 205, 86)",
            "rgb(75, 192, 192)",
            "rgb(54, 162, 235)",
            "rgb(153, 102, 255)",
            "rgb(84, 221, 154)",
          ],
          borderWidth: 1,
        },
      ],
    }),
    [subData]
  );

  //10Î≤à Ïú†Ï†ÄÏùò 3Î≤àÎç∞Ïù¥ÌÑ∞ Ï¶â :id/:idÎäêÎÇåÏúºÎ°ú Í∞ÄÏïºÌï†ÎìØ Ïù¥Í≤å ÎêòÎÇò?
  //ÏïÑÎãàÎ©¥ ÏûîÏ©å ÎπÑÌö®Ïú®Ï†ÅÏù¥Í≤å Ìïú ÌéòÏù¥ÏßÄÎ•º Îòê ÎßåÎì§Ïñ¥ÏÑú Ìï¥Î≥¥Ïûê ÎÇ¥Ïùº
  useEffect(() => {
    axios
      .get(`http://localhost:8080/todaytimes/byuserId/${id}`)
      .then((response) => {
        setListOfPosts(response.data);
      });

    if (!localStorage.getItem("accessToken")) {
      navigate("/auth/login");
      alert("Î°úÍ∑∏Ïù∏ÎêòÏñ¥ÏûàÎÇòÏöî?ü§î");
    }
    axios
      .get("http://localhost:8080/auth/auth", {
        headers: {
          accessToken: localStorage.getItem("accessToken"),
        },
      })
      .then((res) => {
        if (res.data.error) {
          setAuthState({ ...authState, status: false });
        } else {
          setAuthState({
            id: res.data.id,
            status: true,
          });
        }
      });
    axios.get(`http://localhost:8080/todaytimes/byId/${id}`).then((res) => {
      setUserId(res.data);
      setPosts(res.data);
    });
  }, []);

  let link = "0";
  return (
    <S.AllContainer>
      <S.Slider>
        <S.TotalContainer>
          <S.DayContainer>
            {listOfPosts.map((value: any, key: any) => {
              return (
                <div key={key}>
                  <S.DayTime
                    onClick={() => {
                      navigate(`/myinfo/myplan/${value.user_id}/${value.id}`);
                    }}
                  >
                    {value.createdAt.slice(5, 10)}
                  </S.DayTime>
                </div>
              );
            })}
          </S.DayContainer>
        </S.TotalContainer>
      </S.Slider>
      {link === "0" ? <BarGraph chartData={time} /> : <></>}
    </S.AllContainer>
  );
  /**
   * ÏóêÎü¨Í∞Ä ÎÇòÎäî Ïù¥Ïú†Îäî byIdÏóêÏÑú Î∂àÎü¨Ïò¨ idÍ∞Ä Í≤ΩÎ°úÏóê ÌïÑÏöîÌïúÎç∞ Í∑∏ Í≤ΩÎ°úÎ•º jungÏúºÎ°ú Î∞õÏïÑÏò§ÎãàÍπå Îç∞Ïù¥ÌÑ∞Î•º Î™ªÎ∂àÎü¨Ïò¥
   * Í∑∏ÎûòÏÑú ÌååÏùº Í≤ΩÎ°ú ÌïòÎÇòÎ•º Îçî ÎßåÎì§Ïñ¥ÏÑú „Öá„Ñ¥ Í∑ºÎç∞ Ïï†Ï¥àÏóê Ïù¥Îü¨Î©¥ ÎëòÎã§ ÎèôÏãúÏóê Î™ªÎ∂àÎü¨Ïò§ÎäîÎîî..
   * ÏôúÎÉêÎ©¥ ÌïòÎÇòÎäî jungÏúºÎ°ú Î∞õÏïÑÏò§Í≥† ÌïòÎÇòÎäî idÎ°ú Î∞õÏïÑÏôÄÏÑú Í∑∏ÎûòÌîÑÍ∞Ä ÏûàÎäî ÌååÏùºÏóêÏÑúÎäî
   * ÎÇ†Ïßú Î¶¨Ïä§Ìä∏Î•º Î™ªÎ∞õÏïÑÏò§ÏûñÏïÑ
   */
};
